import * as React from "react";
import { Routes, Route } from "react-router-dom";
import { Register } from './page/Register'

function App() {
    return (
        <div className="App">
            <Routes>
                <Route path="/Register" element={<Register />} exact />
            </Routes>
        </div>
    );
}

export default App;
